import './../css/Home.css'

const Home = () => {
    
    return (
        <div className="home">
            <div className="studentProfile">
                <h2>Your Profile</h2>
                <div className="studentDetail">
                    <h3>Name:</h3>
                    <p></p>
                </div>
            </div>
            <div className="logForm">
                <h2>Log Form</h2>
            </div>
        </div>
    )
}

export {
    Home
}
